Swapna Sanchari (2011) Malayalam DVDrip.xvid.AAC - MJY 


Swapna Sanchari  is a 2011 Malayalam comedy drama film directed by Kamal, starring Jayaram and Samvrutha Sunil in the lead roles. It was a success at the box office.

Directed by	Kamal
Produced by	Emmanuel Thankachan
Screenplay by	Girish Kumar
Starring	Jayaram
Samvrutha Sunil
Music by	M. Jayachandran
Cinematography	Alagappan
Studio	Trueline Cinema
Release date(s)	November 25, 2011
Country	India
Language	Malayalam




